import DarrowIcon from "../icons/darrow";

function Menu() {
  const position = { label: "", dropdown: "" };
  const design = {
    text: "font-light tracking-wide cursor-pointer",
    hovertext: "hover:text-gray-300",
  };

  return (
    <>
      <div className={position.label}>
        <h2 className={design.text}>Sort</h2>
        <DarrowIcon />
      </div>
      <div className={position.dropdown}>
        <p className={`${design.text} ${design.hovertext}`}>Newest</p>
        <p className={`${design.text} ${design.hovertext}`}>
          Price: High to Low
        </p>
        <p className={`${design.text} ${design.hovertext}`}>
          Price: Low to High
        </p>
      </div>
    </>
  );
}

export default Menu;
